              <ul>
                {users.map(users => {
                  return (
                    <li>{users.birthDate}</li>
                  )
                })}
              </ul>
            </ContainerData>
          </Data>
        </Semanas>
        <Semanas>
          <TileSemana>Segunda-feira</TileSemana>
          <Data>
            <Title> Nome
              <ul>
                {users.map(users => {
                  return (
                    <li>{users.name}</li>
                  )
                })}
              </ul>
            </Title>
            <Title> Bithdate
              <ul>
                {users.map(users => {
                  return (
                    <li>{users.birthDate}</li>
                  )
                })}
              </ul>
            </Title>
          </Data>
        </Semanas>
        <Semanas>
          <TileSemana>Treça-feira</TileSemana>
          <Data>
            <Title> Nome
              <ul>
                {users.map(users => {
                  return (
                    <li>{users.name}</li>
                  )
                })}
              </ul>
            </Title>
            <Title> Bithdate
              <ul>
                {users.map(users => {
                  return (
                    <li>{users.birthDate}</li>
                  )
                })}
              </ul>
            </Title>
          </Data>
        </Semanas>
        <Semanas>
          <TileSemana>Quarta-feira</TileSemana>
          <Data>
            <Title> Nome
              <ul>
                {users.map(users => {
                  return (
                    <li>{users.name}</li>
                  )
                })}
              </ul>
            </Title>
            <Title> Bithdate
              <ul>
                {users.map(users => {
                  return (
                    <li>{users.birthDate}</li>
                  )
                })}
              </ul>
            </Title>
          </Data>
        </Semanas>
        <Semanas>
          <TileSemana>Quintafeira</TileSemana>
          <Data>
            <Title> Nome
              <ul>
                {users.map(users => {
                  return (
                    <li>{users.name}</li>
                  )
                })}
              </ul>
            </Title>
            <Title> Bithdate
              <ul>
                {users.map(users => {
                  return (
                    <li>{users.birthDate}</li>
                  )
                })}
              </ul>
            </Title>
          </Data>
        </Semanas>
        <Semanas>
          <TileSemana>Sexta-feira</TileSemana>
          <Data>
            <Title> Nome
              <ul>
                {users.map(users => {
                  return (
                    <li>{users.name}</li>
                  )
                })}
              </ul>
            </Title>
            <Title> Bithdate
              <ul>
                {users.map(users => {
                  return (
                    <li>{users.birthDate}</li>
                  )
                })}
              </ul>
            </Title>
          </Data>
        </Semanas>
        <Semanas>
          <TileSemana>Sababo</TileSemana>
          <Data>
            <Title> Nome
              <ul>
                {users.map(users => {
                  return (
                    <li>{users.name}</li>
                  )
                })}
              </ul>
            </Title>
            <Title> Bithdate
              <ul>
                {users.map(users => {
                  return (
                    <li>{users.birthDate}</li>
                  )
                })}
              </ul>
            </Title>
          </Data>
        </Semanas>
      </ContainerSemana>
    </Container>
  )
}
